package number_76;


import java.util.HashMap;
import java.util.LinkedList;
//超时 拼接字符串哪一步骤,太耗时间了
class Solution1 {
    public String minWindow(String s, String t) {

        String resultStr = "";
        if(s.length() < 1 || t.length() < 1) return resultStr;


        HashMap<Character,Integer> targetMap = new HashMap<>();

        for (int i = 0; i < t.length(); i++) {
            Character c = t.charAt(i);
            handleMapAddKey(targetMap,c);
        }


        LinkedList<Character> slider = new LinkedList<>();
        HashMap<Character,Integer> sliderMap = new HashMap<>();

        for (int i = 0; i < s.length(); i++) {
            Character c = s.charAt(i);
            slider.add(c);

            handleMapAddKey(sliderMap,c);

            while (coverStr(sliderMap,targetMap)) {

                if(resultStr.equals("")) {
                    resultStr = getSliderStr(slider);
                }
                else {
                    if(resultStr.length() > slider.size()) {
                        resultStr = getSliderStr(slider);
                    }
                }
                Character pollC = slider.pollFirst();
                handleMapDelKey(sliderMap,pollC);
            }
        }

        return resultStr;
    }

    private boolean coverStr(HashMap<Character, Integer> sliderMap, HashMap<Character, Integer> targetMap) {
        for (Character c : targetMap.keySet()) {
            if(sliderMap.containsKey(c)) {
                int targetValue = targetMap.get(c).intValue();
                int sliderValue = sliderMap.get(c).intValue();
                if(sliderValue < targetValue) {
                    return false;
                }

            }
            else {
                return false;
            }
        }

        return true;
    }

    private void handleMapAddKey(HashMap<Character, Integer> map, Character c) {

        if(map.containsKey(c)) {
            int value = map.get(c).intValue();;
            map.put(c,value + 1);
        }
        else {
            map.put(c,1);
        }
    }

    private void handleMapDelKey(HashMap<Character, Integer> map, Character c) {
        if(map.containsKey(c)) {
            int value = map.get(c).intValue();
            if(value == 1) {
                map.remove(c);
            }
            else {
                map.put(c,value - 1);
            }
        }

    }

    private String getSliderStr(LinkedList<Character> slider) {
        StringBuilder builder = new StringBuilder("");

        for (int i = 0; i < slider.size(); i++) {
            builder.append(slider.get(i));
        }
        return builder.toString();
    }

    public static void main(String[] args) {
        Solution1 solution1 = new Solution1();

        String str1 = "";
        String str2 = "";

        System.out.println(solution1.minWindow(str1, str2));


    }
}